import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 38.2-5810 Statutory construction and relationship to other laws.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-5810.md","filePath":"vacode/38.2-5810.md"}'),r={name:"vacode/38.2-5810.md"},i=o('<h1 id="§-38-2-5810-statutory-construction-and-relationship-to-other-laws" tabindex="-1">§ 38.2-5810 Statutory construction and relationship to other laws. <a class="header-anchor" href="#§-38-2-5810-statutory-construction-and-relationship-to-other-laws" aria-label="Permalink to &quot;§ 38.2-5810 Statutory construction and relationship to other laws.&quot;">​</a></h1><p>A. Neither the health carrier nor the MCHIP shall be deemed to be engaged in the practice of medicine solely by virtue of its compliance with this chapter. All health care providers associated with an MCHIP shall be subject to all provisions of law.</p><p>B. Notwithstanding the definition of an eligible employee as set forth in § <a href="http://law.lis.virginia.gov/vacode/38.2-3431/" target="_blank" rel="noreferrer">38.2-3431</a>, a health carrier providing an MCHIP subject to § <a href="http://law.lis.virginia.gov/vacode/38.2-3431/" target="_blank" rel="noreferrer">38.2-3431</a> shall not be required to offer coverage to or accept applications from an employee who does not reside within the MCHIP&#39;s service area.</p><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0891" target="_blank" rel="noreferrer">891</a>.</p>',4),n=[i];function s(l,c,h,d,p,_){return t(),a("div",null,n)}const v=e(r,[["render",s]]);export{u as __pageData,v as default};
